import React from 'react';

const Navbar = () => {
  return (
    <nav className='navbar bg-success'>
      <h1>
        <i className='fab fa-github' /> GitHub Finder
      </h1>
      <ul>
        <li>
          <a href='#'>Home</a>
          <a href='#'>About</a>
        </li>
      </ul>
    </nav>
  );
};

export default Navbar;
